  input: '"TEXT","F3XA",,"In response to your letter date May 23, 2002, Republican
    Majority Fund includes a request for a contributor''s name, address, occupation
    and employer as required by federal law in every solicitation it does.  If a contribution
    is received without it, a written request for the information is sent within 30
    days, along with a pre-addressed return envelope.  Any contributor information
    received as a result of the PAC''s best efforts is reported to the Commission
    either in an amended report or on the next report. With regard to administrative
    expenses, Republican Majority Fund retains a law firm to house and administer
    its PAC.  Usual administrative expenses to which you refer are included in the
    firm''s retainer, including rent, phones, faxes, etc., and the PAC does not have
